        description: {
          version: 1,
          type: 'doc',
          content: [
            {
              type: 'paragraph',
              content: [
                {
                  type: 'text',
                  text:
                    'We allow enabling it for the entire project, but some customers would prefer to decide on a issue basis if customers should see the checklist items or progress. ',
                },
              ],
            },
            {
              type: 'paragraph',
              content: [
                {
                  type: 'text',
                  text:
                    'Let\'s add to the dropdown menu a new section "Service Desk", and below actions:',
                },
              ],
            },
            {
              type: 'bulletList',
              content: [
                {
                  type: 'listItem',
                  content: [
                    {
                      type: 'paragraph',
                      content: [
                        {
                          type: 'text',
                          text: 'Show/Hide progress to/from users',
                        },
                      ],
                    },
                  ],
                },
                {
                  type: 'listItem',
                  content: [
                    {
                      type: 'paragraph',
                      content: [
                        {
                          type: 'text',
                          text: 'Show/Hide read-only to/from users',
                        },
                      ],
                    },
                  ],
                },
              ],
            },
            {
              type: 'paragraph',
              content: [
                {
                  type: 'text',
                  text:
                    'Of course, we only add it to the menu from issues in the Jira Service Desk type of projects. ',
                },
              ],
            },
            {
              type: 'paragraph',
              content: [
                {
                  type: 'text',
                  text:
                    'Clicking the menu should add some entity property which is next used to show the checklist in customers. Something like the project settings (but this time on an issue-level): ',
                },
                {
                  type: 'text',
                  text:
                    'https://herocoders.atlassian.net/wiki/spaces/IC/pages/1192230913/Enable+checklist+in+JSD+customer+view',
                  marks: [
                    {
                      type: 'link',
                      attrs: {
                        href:
                          'https://herocoders.atlassian.net/wiki/spaces/IC/pages/1192230913/Enable+checklist+in+JSD+customer+view',
                      },
                    },
                  ],
                },
              ],
            },
          ],
        },
