        description: {
          version: 1,
          type: 'doc',
          content: [
            {
              type: 'paragraph',
              content: [
                {
                  type: 'text',
                  text:
                    'Currently, our dropdown menu does not work with screen readers (get focus?) when expanded. It causes some UI/UX problems, like:',
                },
              ],
            },
            {
              type: 'bulletList',
              content: [
                {
                  type: 'listItem',
                  content: [
                    {
                      type: 'paragraph',
                      content: [
                        {
                          type: 'text',
                          text:
                            'Scrolling does not work correctly in some cases and background items list is scrolled up/down (I saw it in Jira mobile app for example)',
                        },
                      ],
                    },
                  ],
                },
                {
                  type: 'listItem',
                  content: [
                    {
                      type: 'paragraph',
                      content: [
                        {
                          type: 'text',
                          text:
                            'Screen-readers are not able to go through the list of actions/button in the dropdown',
                        },
                      ],
                    },
                  ],
                },
              ],
            },
            {
              type: 'paragraph',
              content: [
                {
                  type: 'text',
                  text:
                    'When comes to the screen-readers. Hire is a short list of available solutions: ',
                },
              ],
            },
            {
              type: 'bulletList',
              content: [
                {
                  type: 'listItem',
                  content: [
                    {
                      type: 'paragraph',
                      content: [
                        { type: 'text', text: '(macOS built-in) Voice-over' },
                      ],
                    },
                  ],
                },
                {
                  type: 'listItem',
                  content: [
                    {
                      type: 'paragraph',
                      content: [
                        {
                          type: 'text',
                          text: '(Windows 10 built-in) Narrator',
                        },
                      ],
                    },
                  ],
                },
                {
                  type: 'listItem',
                  content: [
                    {
                      type: 'paragraph',
                      content: [
                        { type: 'text', text: '(Windows 7 SP1+) NVDA (free) ' },
                        {
                          type: 'text',
                          text: 'https://www.nvaccess.org/download/',
                          marks: [
                            {
                              type: 'link',
                              attrs: {
                                href: 'https://www.nvaccess.org/download/',
                              },
                            },
                          ],
                        },
                      ],
                    },
                  ],
                },
                {
                  type: 'listItem',
                  content: [
                    {
                      type: 'paragraph',
                      content: [
                        { type: 'text', text: '(Linux) Orca ' },
                        {
                          type: 'text',
                          text:
                            'https://docs.oracle.com/en/operating-systems/oracle-linux/7/accessibility/ol-assistive-orca.html',
                          marks: [
                            {
                              type: 'link',
                              attrs: {
                                href:
                                  'https://docs.oracle.com/en/operating-systems/oracle-linux/7/accessibility/ol-assistive-orca.html',
                              },
                            },
                          ],
                        },
                      ],
                    },
                  ],
                },
              ],
            },
          ],
        },
